import React from "react";

function First(props) {
    return (
        <div>
            <h1> Name: {props.firstName}</h1>
            <h1>LastName: {props.lastName}</h1>
            <h1>Email Address: {props.email}</h1>
            <hr/>
        </div>
    )
}

export default First
